export const login = () => {
  return { type: "SIGN_IN" };
};

export const newData = data => {
  return { type: "NEW_DATA", payload: data };
};

export const sort = data => {
  return { type: "SORT", payload: data };
};

export const filter = data => {
  return { type: "FILTER", payload: data };
};
